import Searchbar from './Searchbar';
import React, { useState, useEffect } from 'react';

const client_id = '1840d8c49ff1481c8748e3e4188f320f';
const client_secret = 'c81dfd43be3746b894a59a9956a1247e';


const Searchresults = async () => {    
 const searchEndPoint = 'https://api.spotify.com/v1/search'; 
 const searchQuery = 'Civic';
 const urlToFetch = `${searchEndPoint}?q=${searchQuery}&type=track`; 
 try {
     const response = await fetch(urlToFetch, {
        headers: {
            'Authorization': 'Basic ' + (new Buffer.from(client_id + ':' + client_secret).toString('base64'))
          }
     } );
     if (response.ok) {
       const jsonResponse = await response.json();
       const songs = jsonResponse.response;
       return (
        <div>
        {JSON.stringify(songs)}
      </div>
       )
     }
  } catch (error) {
    console.log(error);
  }  
 } 


export default Searchresults
